export const AddTask = () => {
    return axios({
        method: "post",
        url: "https://api-nodejs-todolist.herokuapp.com/task",
        data: {
            id: "617e7e9c8136400017723611",
            description: "reading book",
            category: "JS",
            Content: "11"
        }
    });
}
